(5090, 1, 'admin/faqs', 'POST', '112.133.236.143', '{\"question\":\"Do you mix my clothes with other people\'s clothes?\",\"question_ar\":\"\\u0647\\u0644 \\u062a\\u062e\\u0644\\u0637 \\u0645\\u0644\\u0627\\u0628\\u0633\\u064a \\u0645\\u0639 \\u0645\\u0644\\u0627\\u0628\\u0633 \\u0627\\u0644\\u0622\\u062e\\u0631\\u064a\\u0646\\u061f\",\"answer\":\"We do not mix any of your clothes with those of others in order to maintain hygiene.\",\"answer_ar\":\"\\u0646\\u062d\\u0646 \\u0644\\u0627 \\u0646\\u062e\\u0644\\u0637 \\u0623\\u064a \\u0645\\u0646 \\u0645\\u0644\\u0627\\u0628\\u0633\\u0643 \\u0645\\u0639 \\u0645\\u0644\\u0627\\u0628\\u0633 \\u0627\\u0644\\u0622\\u062e\\u0631\\u064a\\u0646 \\u0645\\u0646 \\u0623\\u062c\\u0644 \\u0627\\u0644\\u062d\\u0641\\u0627\\u0638 \\u0639\\u0644\\u0649 \\u0627\\u0644\\u0646\\u0638\\u0627\\u0641\\u0629.\",\"status\":\"1\",\"_token\":\"ivprddx1Rxm8B292vc40rF9b77EK1a946TJElG3q\",\"_previous_\":\"http:\\/\\/launderhut.demoproducts.in\\/admin\\/faqs\"}', '2020-11-16 17:24:17', '2020-11-16 17:24:17'),
