(5096, 1, 'admin/faqs', 'POST', '112.133.236.143', '{\"question\":\"My items are missing or damaged?\",\"question_ar\":\"\\u0639\\u0646\\u0627\\u0635\\u0631\\u064a \\u0645\\u0641\\u0642\\u0648\\u062f\\u0629 \\u0623\\u0648 \\u062a\\u0627\\u0644\\u0641\\u0629\\u061f\",\"answer\":\"We take missing or damaged items extremely serious.  You can email to support@rithlaundry.com as soon as possible with details and pictures. We treat each case individually our support team will be in contact to you within 24 hours.\",\"answer_ar\":\"\\u0646\\u0623\\u062e\\u0630 \\u0627\\u0644\\u0639\\u0646\\u0627\\u0635\\u0631 \\u0627\\u0644\\u0645\\u0641\\u0642\\u0648\\u062f\\u0629 \\u0623\\u0648 \\u0627\\u0644\\u062a\\u0627\\u0644\\u0641\\u0629 \\u062e\\u0637\\u064a\\u0631\\u0629 \\u0644\\u0644\\u063a\\u0627\\u064a\\u0629. \\u064a\\u0645\\u0643\\u0646\\u0643 \\u0625\\u0631\\u0633\\u0627\\u0644 \\u0628\\u0631\\u064a\\u062f \\u0625\\u0644\\u0643\\u062a\\u0631\\u0648\\u0646\\u064a \\u0625\\u0644\\u0649 support@rithlaundry.com \\u0641\\u064a \\u0623\\u0642\\u0631\\u0628 \\u0648\\u0642\\u062a \\u0645\\u0645\\u0643\\u0646 \\u0645\\u0639 \\u0627\\u0644\\u062a\\u0641\\u0627\\u0635\\u064a\\u0644 \\u0648\\u0627\\u0644\\u0635\\u0648\\u0631. \\u0646\\u062a\\u0639\\u0627\\u0645\\u0644 \\u0645\\u0639 \\u0643\\u0644 \\u062d\\u0627\\u0644\\u0629 \\u0639\\u0644\\u0649 \\u062d\\u062f\\u0629 \\u060c \\u0648\\u0633\\u064a\\u062a\\u0635\\u0644 \\u0628\\u0643 \\u0641\\u0631\\u064a\\u0642 \\u0627\\u0644\\u062f\\u0639\\u0645 \\u0644\\u062f\\u064a\\u0646\\u0627 \\u0641\\u064a \\u063a\\u0636\\u0648\\u0646 24 \\u0633\\u0627\\u0639\\u0629.\",\"status\":\"1\",\"_token\":\"ivprddx1Rxm8B292vc40rF9b77EK1a946TJElG3q\",\"_previous_\":\"http:\\/\\/launderhut.demoproducts.in\\/admin\\/faqs\"}', '2020-11-16 17:25:37', '2020-11-16 17:25:37'),
