(5105, 1, 'admin/faqs', 'POST', '112.133.236.143', '{\"question\":\"What chemicals and detergents do you use?\",\"question_ar\":\"\\u0645\\u0627 \\u0647\\u064a \\u0627\\u0644\\u0645\\u0648\\u0627\\u062f \\u0627\\u0644\\u0643\\u064a\\u0645\\u064a\\u0627\\u0626\\u064a\\u0629 \\u0648\\u0627\\u0644\\u0645\\u0646\\u0638\\u0641\\u0627\\u062a \\u0627\\u0644\\u062a\\u064a \\u062a\\u0633\\u062a\\u062e\\u062f\\u0645\\u0647\\u0627\\u061f\",\"answer\":\"For laundry we use detergents (which  are easily available in our markets) along with additives such as vanish, comfort fabric conditioners, Rin Ala and other standard detergents.\",\"answer_ar\":\"\\u0628\\u0627\\u0644\\u0646\\u0633\\u0628\\u0629 \\u0644\\u0644\\u063a\\u0633\\u064a\\u0644 \\u060c \\u0646\\u0633\\u062a\\u062e\\u062f\\u0645 \\u0627\\u0644\\u0645\\u0646\\u0638\\u0641\\u0627\\u062a (\\u0627\\u0644\\u062a\\u064a \\u062a\\u062a\\u0648\\u0641\\u0631 \\u0628\\u0633\\u0647\\u0648\\u0644\\u0629 \\u0641\\u064a \\u0623\\u0633\\u0648\\u0627\\u0642\\u0646\\u0627) \\u062c\\u0646\\u0628\\u064b\\u0627 \\u0625\\u0644\\u0649 \\u062c\\u0646\\u0628 \\u0645\\u0639 \\u0627\\u0644\\u0625\\u0636\\u0627\\u0641\\u0627\\u062a \\u0645\\u062b\\u0644 \\u0641\\u0627\\u0646\\u064a\\u0634 \\u060c \\u0648\\u0645\\u0643\\u064a\\u0641\\u0627\\u062a \\u0627\\u0644\\u0623\\u0642\\u0645\\u0634\\u0629 \\u0627\\u0644\\u0645\\u0631\\u064a\\u062d\\u0629 \\u060c \\u0648\\u0631\\u064a\\u0646 \\u0623\\u0644\\u0627 \\u0648\\u0627\\u0644\\u0645\\u0646\\u0638\\u0641\\u0627\\u062a \\u0627\\u0644\\u0642\\u064a\\u0627\\u0633\\u064a\\u0629 \\u0627\\u0644\\u0623\\u062e\\u0631\\u0649.\",\"status\":\"1\",\"_token\":\"ivprddx1Rxm8B292vc40rF9b77EK1a946TJElG3q\",\"_previous_\":\"http:\\/\\/launderhut.demoproducts.in\\/admin\\/faqs\"}', '2020-11-16 17:28:17', '2020-11-16 17:28:17'),
