(5108, 1, 'admin/faqs', 'POST', '112.133.236.143', '{\"question\":\"What hours can I get my laundry picked up or delivered?\",\"question_ar\":\"\\u0645\\u0627 \\u0647\\u064a \\u0627\\u0644\\u0633\\u0627\\u0639\\u0627\\u062a \\u0627\\u0644\\u062a\\u064a \\u064a\\u0645\\u0643\\u0646\\u0646\\u064a \\u062e\\u0644\\u0627\\u0644\\u0647\\u0627 \\u0627\\u0644\\u062d\\u0635\\u0648\\u0644 \\u0639\\u0644\\u0649 \\u0627\\u0644\\u063a\\u0633\\u064a\\u0644 \\u0627\\u0644\\u062e\\u0627\\u0635 \\u0628\\u064a \\u0623\\u0648 \\u062a\\u0648\\u0635\\u064a\\u0644\\u0647\\u061f\",\"answer\":\"Pick up and delivery are available from 9am to 9pm.\",\"answer_ar\":\"\\u062a\\u062a\\u0648\\u0641\\u0631 \\u062e\\u062f\\u0645\\u0629 \\u0627\\u0644\\u062a\\u0648\\u0635\\u064a\\u0644 \\u0648\\u0627\\u0644\\u062a\\u0648\\u0635\\u064a\\u0644 \\u0645\\u0646 \\u0627\\u0644\\u0633\\u0627\\u0639\\u0629 9 \\u0635\\u0628\\u0627\\u062d\\u064b\\u0627 \\u062d\\u062a\\u0649 9 \\u0645\\u0633\\u0627\\u0621\\u064b.\",\"status\":\"1\",\"_token\":\"ivprddx1Rxm8B292vc40rF9b77EK1a946TJElG3q\",\"_previous_\":\"http:\\/\\/launderhut.demoproducts.in\\/admin\\/faqs\"}', '2020-11-16 17:28:57', '2020-11-16 17:28:57'),
