(5111, 1, 'admin/faqs', 'POST', '112.133.236.143', '{\"question\":\"How clean is your store?\",\"question_ar\":\"\\u0645\\u0627 \\u0645\\u062f\\u0649 \\u0646\\u0638\\u0627\\u0641\\u0629 \\u0645\\u062a\\u062c\\u0631\\u0643\\u061f\",\"answer\":\"The cleanliness of our store is our pride. In fact we have special team to handle the cleanliness of the store.\",\"answer_ar\":\"\\u0646\\u0638\\u0627\\u0641\\u0629 \\u0645\\u062a\\u062c\\u0631\\u0646\\u0627 \\u0647\\u064a \\u0641\\u062e\\u0631\\u0646\\u0627. \\u0641\\u064a \\u0627\\u0644\\u0648\\u0627\\u0642\\u0639 \\u0644\\u062f\\u064a\\u0646\\u0627 \\u0641\\u0631\\u064a\\u0642 \\u062e\\u0627\\u0635 \\u0644\\u0644\\u062a\\u0639\\u0627\\u0645\\u0644 \\u0645\\u0639 \\u0646\\u0638\\u0627\\u0641\\u0629 \\u0627\\u0644\\u0645\\u062a\\u062c\\u0631.\",\"status\":\"1\",\"_token\":\"ivprddx1Rxm8B292vc40rF9b77EK1a946TJElG3q\",\"_previous_\":\"http:\\/\\/launderhut.demoproducts.in\\/admin\\/faqs\"}', '2020-11-16 17:29:36', '2020-11-16 17:29:36'),
