(5114, 1, 'admin/faqs', 'POST', '112.133.236.143', '{\"question\":\"What if I leave any personnel items in my pockets by mistake?\",\"question_ar\":\"\\u0645\\u0627\\u0630\\u0627 \\u0644\\u0648 \\u062a\\u0631\\u0643\\u062a \\u0623\\u064a \\u0639\\u0646\\u0627\\u0635\\u0631 \\u0634\\u062e\\u0635\\u064a\\u0629 \\u0641\\u064a \\u062c\\u064a\\u0648\\u0628\\u064a \\u0639\\u0646 \\u0637\\u0631\\u064a\\u0642 \\u0627\\u0644\\u062e\\u0637\\u0623\\u061f\",\"answer\":\"We shall check  the laundry while pickup and return back, if we find any personnel belongings. In case we find any at our store during the cleaning process, we will take care of them and shall call you to let you know about the same.\",\"answer_ar\":\"\\u0633\\u0648\\u0641 \\u0646\\u062a\\u062d\\u0642\\u0642 \\u0645\\u0646 \\u0627\\u0644\\u063a\\u0633\\u064a\\u0644 \\u0623\\u062b\\u0646\\u0627\\u0621 \\u0627\\u0644\\u0627\\u0633\\u062a\\u0644\\u0627\\u0645 \\u0648\\u0646\\u0639\\u0648\\u062f \\u060c \\u0625\\u0630\\u0627 \\u0648\\u062c\\u062f\\u0646\\u0627 \\u0623\\u064a \\u0645\\u062a\\u0639\\u0644\\u0642\\u0627\\u062a \\u0634\\u062e\\u0635\\u064a\\u0629. \\u0641\\u064a \\u062d\\u0627\\u0644\\u0629 \\u0627\\u0644\\u0639\\u062b\\u0648\\u0631 \\u0639\\u0644\\u0649 \\u0623\\u064a \\u0645\\u0646\\u0647\\u0627 \\u0641\\u064a \\u0645\\u062a\\u062c\\u0631\\u0646\\u0627 \\u0623\\u062b\\u0646\\u0627\\u0621 \\u0639\\u0645\\u0644\\u064a\\u0629 \\u0627\\u0644\\u062a\\u0646\\u0638\\u064a\\u0641 \\u060c \\u0641\\u0633\\u0648\\u0641 \\u0646\\u0647\\u062a\\u0645 \\u0628\\u0647\\u0627 \\u0648\\u0633\\u0646\\u0642\\u0648\\u0645 \\u0628\\u0627\\u0644\\u0627\\u062a\\u0635\\u0627\\u0644 \\u0628\\u0643 \\u0644\\u0625\\u0628\\u0644\\u0627\\u063a\\u0643 \\u0639\\u0646 \\u0630\\u0644\\u0643.\",\"status\":\"1\",\"_token\":\"ivprddx1Rxm8B292vc40rF9b77EK1a946TJElG3q\",\"_previous_\":\"http:\\/\\/launderhut.demoproducts.in\\/admin\\/faqs\"}', '2020-11-16 17:30:16', '2020-11-16 17:30:16'),
