INSERT INTO `faqs` (`id`, `question`, `question_ar`, `answer`, `answer_ar`, `status`, `created_at`, `updated_at`) VALUES
(1, 'How do I book my pickup?', 'كيف أحجز سيارة النقل الخاصة بي؟', 'You can download our app and create an account and place your laundry pickup.', 'يمكنك تنزيل تطبيقنا وإنشاء حساب ووضع خدمة غسيل الملابس الخاصة بك.', 1, '2020-11-16 17:23:32', '2020-11-16 17:23:32'),
(2, 'Do you mix my clothes with other people\'s clothes?', 'هل تخلط ملابسي مع ملابس الآخرين؟', 'We do not mix any of your clothes with those of others in order to maintain hygiene.', 'نحن لا نخلط أي من ملابسك مع ملابس الآخرين من أجل الحفاظ على النظافة.', 1, '2020-11-16 17:24:17', '2020-11-16 17:24:17'),
(3, 'How do I have to pay for your service?', 'كيف يجب أن أدفع مقابل خدمتك؟', 'Payment shall be collected at the time of delivery of garments .', 'يتم تحصيل المبلغ عند تسليم الملابس.', 1, '2020-11-16 17:24:58', '2020-11-16 17:24:58'),
(4, 'My items are missing or damaged?', 'عناصري مفقودة أو تالفة؟', 'We take missing or damaged items extremely serious.  You can email to support@rithlaundry.com as soon as possible with details and pictures. We treat each case individually our support team will be in contact to you within 24 hours.', 'نأخذ العناصر المفقودة أو التالفة خطيرة للغاية. يمكنك إرسال بريد إلكتروني إلى support@rithlaundry.com في أقرب وقت ممكن مع التفاصيل والصور. نتعامل مع كل حالة على حدة ، وسيتصل بك فريق الدعم لدينا في غضون 24 ساعة.', 1, '2020-11-16 17:25:37', '2020-11-16 17:25:37'),
(5, 'Can you wash comforters,  blankets and quilts?', 'يمكنك غسل المعزون والبطانيات واللحف؟', 'Yes. Please see our duved cleaning service page for further details.', 'نعم. يرجى الاطلاع على صفحة خدمة تنظيف duva لمزيد من التفاصيل.', 1, '2020-11-16 17:26:38', '2020-11-16 17:26:38'),
(6, 'What services do you provide?', 'ما هي الخدمات التي تقدمونها؟', 'Rith Laundry provides the following services: cloth washing, Ironing and cloth repair.', 'توفر مغسلة ريث الخدمات التالية: غسيل الملابس ، الكي وإصلاح القماش.', 1, '2020-11-16 17:27:30', '2020-11-16 17:27:30'),
(7, 'What chemicals and detergents do you use?', 'ما هي المواد الكيميائية والمنظفات التي تستخدمها؟', 'For laundry we use detergents (which  are easily available in our markets) along with additives such as vanish, comfort fabric conditioners, Rin Ala and other standard detergents.', 'بالنسبة للغسيل ، نستخدم المنظفات (التي تتوفر بسهولة في أسواقنا) جنبًا إلى جنب مع الإضافات مثل فانيش ، ومكيفات الأقمشة المريحة ، ورين ألا والمنظفات القياسية الأخرى.', 1, '2020-11-16 17:28:17', '2020-11-16 17:28:17'),
(8, 'What hours can I get my laundry picked up or delivered?', 'ما هي الساعات التي يمكنني خلالها الحصول على الغسيل الخاص بي أو توصيله؟', 'Pick up and delivery are available from 9am to 9pm.', 'تتوفر خدمة التوصيل والتوصيل من الساعة 9 صباحًا حتى 9 مساءً.', 1, '2020-11-16 17:28:57', '2020-11-16 17:28:57'),
(9, 'How clean is your store?', 'ما مدى نظافة متجرك؟', 'The cleanliness of our store is our pride. In fact we have special team to handle the cleanliness of the store.', 'نظافة متجرنا هي فخرنا. في الواقع لدينا فريق خاص للتعامل مع نظافة المتجر.', 1, '2020-11-16 17:29:36', '2020-11-16 17:29:36'),
(10, 'What if I leave any personnel items in my pockets by mistake?', 'ماذا لو تركت أي عناصر شخصية في جيوبي عن طريق الخطأ؟', 'We shall check  the laundry while pickup and return back, if we find any personnel belongings. In case we find any at our store during the cleaning process, we will take care of them and shall call you to let you know about the same.', 'سوف نتحقق من الغسيل أثناء الاستلام ونعود ، إذا وجدنا أي متعلقات شخصية. في حالة العثور على أي منها في متجرنا أثناء عملية التنظيف ، فسوف نهتم بها وسنقوم بالاتصال بك لإبلاغك عن ذلك.', 1, '2020-11-16 17:30:16', '2020-11-16 17:30:16');
