INSERT INTO `privacy_policies` (`id`, `title`, `title_ar`, `description`, `description_ar`, `status`, `created_at`, `updated_at`) VALUES
(1, 'About RithLaundry', 'حول مغسلة فلورنس', 'RithLaundry is pleased to provide professional pickup and delivery laundry services to our customers and offers quality and convenience at an affordable price. Our services are subject to the terms and conditions set forth below. Your use of Launderhut services indicates your agreement to be bound by the terms and conditions contained  herein.company never sell your personal information like phone number, address or email Id with any third party.we may change to terms from time to time and it is the current version which will apply to each order when you place it. We will notify you of changes to the Terms by email.', 'يسر مغسلة  فلورنس أن تقدم لعملائها خدمات غسيل وتسليم متخصصة واحترافية للجودة والراحة وبأسعار معقولة. تخضع خدماتنا للشروط والأحكام الواردة أدناه. يشير استخدامك لخدمات  مغسلة  فلورنس إلى موافقتك على الالتزام بالشروط والأحكام الواردة هنا. لا تبيع الشركة أبدًا معلوماتك الشخصية مثل رقم الهاتف أو العنوان أو معرف البريد الإلكتروني مع أي طرف ثالث. قد نتغير إلى الشروط من وقت لآخر وقد هو الإصدار الحالي الذي سيتم تطبيقه على كل طلب عند وضعه. سنخطرك بالتغييرات التي تطرأ على الشروط عبر البريد الإلكتروني.', 1, '2019-08-28 06:45:21', '2022-03-16 07:15:07'),
(2, 'Please read the Terms carefully and make sure that you understand them before placing an order.', 'يرجى قراءة الشروط بعناية والتأكد من فهمك لها قبل تقديم الطلب.', 'All garments/linen/fabrics are handled with greatest case but owing to the conditions of the clothes or non-apparent/non-visible defects in its material there is a possibility of discoloring or shrinkage such garments are accepted for cleaning at owners risk and we will not accept any responsibility for it.Removal of stain is a part of the process but, complete removal of stains can not be guaranteed and will be processed at customers risk. In case of any loss or damage you must be reported to us with in 24 hours. Failure to report on right time we don\'t take any responsibility. Compensation shall be provided inform of services and no cash will be given to customers. Customers are requested to count the clothes at the time of delivery and inform to the delivery boy in case of missing clothes.  We will not be responsible for any such claims after the clothes delivery has been accepted. Customer might get regular updates through calls/ SMS/ emails/ App notification.', 'يتم التعامل مع جميع الملابس / الكتان / الأقمشة بأكبر قدر من الحالة ولكن بسبب ظروف الملابس أو العيوب غير الظاهرة / غير المرئية في موادها ، هناك احتمال لتغيير لون أو انكماش هذه الملابس مقبولة للتنظيف على خطر الملاك ونحن لن تتحمل أي مسؤولية عن ذلك.إزالة البقع هي جزء من العملية ولكن ، لا يمكن ضمان الإزالة الكاملة للبقع وسيتم معالجتها على مخاطر العملاء. في حالة حدوث أي خسارة أو ضرر يجب الإبلاغ عنها خلال 24 ساعة. عدم الإبلاغ في الوقت المناسب لا نتحمل أي مسؤولية. يجب تقديم التعويض عن الخدمات ولن يتم دفع أي مبالغ نقدية للعملاء. يُطلب من العملاء عد الملابس في وقت التسليم وإبلاغ الصبي في حالة فقدان الملابس. لن نكون مسؤولين عن أي مطالبات من هذا القبيل بعد قبول تسليم الملابس. قد يحصل العميل على تحديثات منتظمة من خلال المكالمات / الرسائل القصيرة / رسائل البريد الإلكتروني / إشعار التطبيق.', 1, '2019-08-28 06:45:35', '2020-09-09 20:50:26');
